import styles from "../components/UI/Welcome.module.css";

const Welcome = () => {
    const hour = new Date().getHours();
    let message = "";

    if (hour >= 0 && hour < 12) {
        message = "Good Morning";
    }
    else if (hour >= 12 && hour <= 18) {
        message = "Good Afternoom";
    }
    else {
        message = "Good Evening";
    }

    return <h1>
        {message}
    </h1>
}

export default Welcome;
